const int INF = 3E14;

void solve() {
    int N, K; cin >> N >> K;
    
    vector<int> A(N);
    for (int &x : A) cin >> x;
    sort(ALL(A));
    
    vector<int> diff(N+1, 0);
    for (int i = 1; i < N; ++i) diff[i] = A[i] - A[i-1];
    
    vector<int> pre1(N), pre2(N), suf1(N), suf2(N);
    partial_sum(ALL(diff) - 1, begin(pre1));
    partial_sum(ALL(pre1), begin(pre2));
    partial_sum(RALL(diff) - 1, rbegin(suf1));
    partial_sum(RALL(suf1), rbegin(suf2));
    
    auto chk = [&](int penalty) -> pii {
        static auto cost = [&](int i, int j) -> int {
            --i, --j; /// 1-base to 0-base
            int m = (i + j) >> 1;
            return suf2[i] - suf2[m] - suf1[m] * (m - i)
                + pre2[j] - pre2[m] - pre1[m] * (j - m)
                + penalty;
        };
        
        struct Interval {int pos, l, r;};
        
        static vector<int> dp(N+1), op(N+1);
        static deque<Interval> deq;
        dp[0] = 0, op[0] = 0;
        deq.eb(0, 1, N);
        for (int i = 1; i <= N; ++i) {
            while (SZ(deq) and deq[0].r < i) deq.pf();
            int opt = deq[0].pos;
            dp[i] = dp[opt] + cost(opt + 1, i), op[i] = op[opt] + 1;
            if (i == N) {deq.clear(); break;}
            while (SZ(deq) and dp[deq.back().pos] + cost(deq.back().pos + 1, deq.back().l) > dp[i] + cost(i + 1, deq.back().l)) deq.pb();
            
            if (deq.empty()) deq.eb(i, i+1, N);
            else {
                int pos = deq.back().pos, lo = deq.back().l, hi = deq.back().r, mi;
                while (lo < hi) {
                    mi = (lo + hi + 1) >> 1;
                    if (dp[pos] + cost(pos + 1, mi) >= dp[i] + cost(i + 1, mi)) hi = mi - 1;
                    else                                                        lo = mi;
                }
                deq.back().r = lo;
                if (lo < N) deq.eb(i, lo+1, N);
            }
        }
        // debug(dp);
        return {dp.back() - op.back() * penalty, op.back()};
    };
    
    // for (int p = 0; p <= 10; ++p) {
    //     auto chk_p = chk(p);
    //     debug(p, chk_p);
    // }
    
    int lo = 0, hi = INF, mi;
    while (lo < hi) {
        mi = (lo + hi) >> 1;
        auto [val, cnt] = chk(mi);
        if (cnt == K) return cout << val << "\n", void();
        else if (cnt < K) hi = mi;
        else              lo = mi + 1;
    }
    // debug(lo, chk(lo));
    // debug(lo-1, chk(lo-1));
    
    auto [val_lo, cnt_lo] = chk(lo);
    auto [val_hi, cnt_hi] = chk(lo - 1);
    cout << val_lo + (val_hi - val_lo) / (cnt_hi - cnt_lo) * (K - cnt_lo) << "\n";
}

