import React, {useState} from 'react';
import {Button, StyleSheet, Text, View} from 'react-native';
import auth, {FirebaseAuthTypes} from '@react-native-firebase/auth';
import {
  GoogleSignin,
  GoogleSigninButton,
} from '@react-native-google-signin/google-signin';

GoogleSignin.configure({
  webClientId:
    '992759692489-juc7v32698a70uo83iff4ti181o151qj.apps.googleusercontent.com',
});

async function onGoogleButtonPress() {
  // Check if your device supports Google Play
  await GoogleSignin.hasPlayServices({showPlayServicesUpdateDialog: true});
  // Get the users ID token
  const {idToken} = await GoogleSignin.signIn();

  // Create a Google credential with the token
  const googleCredential = auth.GoogleAuthProvider.credential(idToken);

  // Sign-in the user with the credential
  const user = await auth().signInWithCredential(googleCredential);
  console.log(user);
  return user;
}

function App(): JSX.Element {
  const [user, setUser] = useState<FirebaseAuthTypes.User | null>(null);
  const handleSignIn = async () => {
    try {
      await onGoogleButtonPress();
      const signedInUser = auth().currentUser;
      setUser(signedInUser);
      console.log('User Signed In: ', signedInUser?.displayName);
    } catch (error) {
      console.log('Error en Sign In: ', error);
    }
  };
  const handleSignOut = async () => {
    try {
      GoogleSignin.revokeAccess();
      setUser(null);
      console.log('User Signed Out');
    } catch (error) {
      console.log('Error en Sign Out: ', error);
    }
  };
  return (
    <View style={styles.container}>
      <GoogleSigninButton
        onPress={() => handleSignIn()}
        disabled={user != null}
      />
      <Button
        title="Sign Out"
        onPress={() => handleSignOut()}
        disabled={user == null}
      />
      {user && <Text>Bienvenido, {user.displayName}</Text>}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
});

