class Solution {
//https://p.ip.fi/GLMR
//https://p.ip.fi/sZpq
    public int minMalwareSpread(int[][] graph, int[] initial) {
        int n=graph.length;
        int m=initial.length;
        Arrays.sort(initial);
        int ans=initial[0];
        int val=Integer.MAX_VALUE;
        HashMap<Integer,ArrayList<Integer>>hm=new HashMap<>();
    for(int k:initial){
        hm.clear();
        for(int i=0;i<n;i++){
            if(graph[k][i]==1){
                graph[k][i]=0;
                if(hm.containsKey(k)) hm.get(k).add(i);
                else{
                    hm.put(k,new ArrayList<Integer>());
                    hm.get(k).add(i);
                }
            }
            if(graph[i][k]==1){
                graph[i][k]=0;
                if(hm.containsKey(i)) hm.get(i).add(k);
                else{
                    hm.put(i,new ArrayList<Integer>());
                    hm.get(i).add(k);
                }
            }
        }
        DSU d= new DSU(n);
        for(int i=0;i<n;i++){
            for(int j=i+1;j<n;j++){
                if(graph[i][j]==1) d.union(i,j);
            }
        }
        int infected=0;
        for(int i:initial){
            if(k!=i){
                infected+=d.size(i);
            }
        }
        if(infected<val){
            ans=k;
            val=infected;
        }
        
        for(int key:hm.keySet()){
            for(int i:hm.get(key)){
                graph[key][i]=1;
            }
        }
    }
    return ans;
    }
}
class DSU{
    private int parent[];
    private int size[];
    public DSU(int n){
        parent=new int[n];
        size=new int[n];
        for(int i=0;i<n;i++){
            parent[i]=i;
            size[i]=1;
        }
    }
    int size(int x){
        return size[x];
    }
    int find(int x){
        if(parent[x]==x)return x;
        return parent[x]=find(parent[x]);
    }
    void union(int a,int b){
        a=find(a);
        b=find(b);
        if(a!=b){
            if(size[b]>size[a]){
                int temp=a;
                a=b;
                b=temp;
            }
            size[a]+=size[b];
            parent[b]=a;
        }
    }
}

