package project;

import java.util.Random;

public class App {
    public static void main(String[] args) {
        int balance = 100000; // Initial balance
        int bet = 20000;

        int attempts = 0;
        while (attempts < 50) {
            int userDice1 = rollDice();
            int userDice2 = rollDice();
            int computerDice1 = rollDice();
            int computerDice2 = rollDice();

            int userSum = userDice1 + userDice2;
            int computerSum = computerDice1 + computerDice2;

            // Displaying results
            System.out.println("Your dice: " + userDice1 + ", " + userDice2);
            System.out.println("Computer dice: " + computerDice1 + ", " + computerDice2);

            // Checking winning conditions
            if (balance <= 0){
            break;
            }
            else if (userDice1 == userDice2 && userDice1 == 6) {
                double winnings = bet * 7 / 2.0;
                balance += winnings;
                System.out.println("Congratulations! You rolled two sixes. You win automatically!");
                System.out.println("You won: " + winnings);
                bet = 20000;
                attempts++;
                continue;
            } else if (userSum > computerSum) {
                if (userDice1 == userDice2) {
                    double winnings = bet * 5 / 2.0;
                    balance += winnings;
                    System.out.println("Congratulations! You rolled a double. You win!");
                    System.out.println("You won: " + winnings);
                    bet = 20000;
                    attempts++;
                    continue;
                } else {
                    double winnings = bet * 3 / 2.0;
                    balance += winnings;
                    System.out.println("Congratulations! You win!");
                    System.out.println("You won: " + winnings);
                    bet = 20000;
                    attempts++;
                    continue;
                }
            } else if (userSum == computerSum) {
                balance = balance;
                System.out.println("Its a draw..Your bet is refunded");
                attempts++;
            } else {
                balance -= bet;
                System.out.println("Sorry, you lost!");
                System.out.println("You lost: " + bet);
                if (balance <= bet){
                    bet = balance;
                }
                else if (bet <= 10000) {
                    bet = bet * 2;
                } else {
                    bet = 20000;
                }
                attempts++;
                continue;
            }
        }

        System.out.println("Your balance: " + balance);
    }

    private static int rollDice() {
        Random random = new Random();
        return random.nextInt(6) + 1; // Generating a random number between 1 and 6
    }

}

