using System.IO;


namespace Login_System
{
    internal class Program
    {
        public static string username;
        public static string directorypath = "C:\\Users\\camde\\source\\repos\\Login System\\Login System\\bin\\Debug\\Users";
        
        public static void Main()
        {
            
            string filename = "login.csv";
            Dictionary<string, string> users = new Dictionary<string, string>();

            // Check if the login file exists
            if (File.Exists(filename))
            {
                string[] loginData = File.ReadAllLines(filename);
                foreach (string line in loginData)
                {
                    string[] parts = line.Split(',');
                    if (parts.Length >= 2)
                    {
                        string username = parts[0];
                        string password = parts[1];
                        users[username] = password;
                    }
                    

                }
                

            }
            else
            {
                Console.WriteLine("Login file not found. Creating a new file...");
               
                File.Create(filename).Close();

                
            }
            

            Console.WriteLine("Login System");


            int i = 0;
            while (i < 5)
            {
                // Prompt for username
                Console.Write("Enter username: ");
                string inputUsername = Console.ReadLine();

                // Prompt for password
                Console.Write("Enter password: ");
                string inputPassword = Console.ReadLine();

                
            
                // Check if the entered username and password match the saved values
                if (users.ContainsKey(inputUsername) && users[inputUsername] == inputPassword && users.ContainsKey(inputUsername) && users[inputUsername] != "Password")
                {
                    Console.WriteLine("Login successful!");
                    
                }
                if (users[inputUsername] != "Password")
                {
                    Console.WriteLine("Sorry you can't have the password as \"Password\"");
                }
                else 
                {
                    Console.WriteLine("Invalid username or password.");

                    // Save the entered username and password in the file
                    users[inputUsername] = inputPassword;
                    SaveUsersToFile(filename, users);
                    Console.WriteLine("User added and login data saved.");
                    string user = $"{inputUsername}.txt";
                    string access = $"C:\\Users\\camde\\source\\repos\\Login System\\Login System\\bin\\Debug\\Users\\{inputUsername}";
                    Directory.CreateDirectory($"{access}");
                    string path = Path.Combine(access, user);
                    FileStream writer = File.Create(path);
                    writer.Close();
                }
            }

            Console.ReadLine();
        }

        static void SaveUsersToFile(string filename, Dictionary<string, string> users)
        {
            List<string> lines = new List<string>();
            foreach (KeyValuePair<string, string> user in users)
            {
                string line = $"{user.Key},{user.Value}";
                lines.Add(line);
            }

            File.WriteAllLines(filename, lines);
        }
    }
}

function graduation (input) {
let student = input[0];
let year = 1;
let index = 1;
let failCount = 0;
let gradeSum = 0;

    while (year <= 12){
        let grade = Number (input [index]);
        index++;
        gradeSum += grade;
                if (grade < 4){
                    failCount++;
                    if (failCount > 1){
                        break;
                    }
                }
        year++;
    }
        if (failCount > 1){
            console.log (`${student} has been excluded at ${year} grade`);
        }else {
            let avgGrade = gradeSum / 12;
            console.log (`${student} graduated. Average grade: ${avgGrade.toFixed(2)});
        }
}
